import { Header } from "./components/Header";
import { Navbar } from "./components/Navbar";
import { Route, Routes } from "react-router-dom";
import Home from "./pages/Home";
import Login from "./pages/Login";
import Signup from "./pages/Signup";
import IssueRegister from "./pages/IssueRegister";
import MyIssues from "./pages/MyIssues";
import Admin from "./pages/Admin";
import IssueDetails from "./pages/IssueDetails";

const Layout = ({ children }) => (
  <>
    <Header />
    <div className="flex flex-grow mt-16">
      <Navbar />
      <div className="flex-grow ml-60">
        {children}
      </div>
    </div>
  </>
);

function App() {
  return (
    <div className="min-h-screen relative flex flex-col">
      <Routes>
        <Route path="/" element={<Layout><Home /></Layout>} />
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<Signup />} />
        <Route path="/issue-register" element={<Layout><IssueRegister /></Layout>} />
        <Route path="/my-issues" element={<Layout><MyIssues /></Layout>} />
        <Route path="/admin" element={<Layout><Admin /></Layout>} />
        <Route path="/issue/:issueNum" element={<Layout><IssueDetails /></Layout>} />
      </Routes>
    </div>
  );
}

export default App;
